// src/components/UserRepositories.js
import React, { useState, useEffect } from 'react';
import GitHubService from '../api/GitHubService';

const UserRepositories = ({ username }) => {
  const [repositories, setRepositories] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchRepositories = async () => {
      try {
        const reposData = await GitHubService.getUserRepos(username);
        setRepositories(reposData);
      } catch (err) {
        setError(err.message || 'Failed to fetch repositories');
      }
    };

    fetchRepositories();
  }, [username]);

  if (error) {
    return <div className="error">{error}</div>;
  }

  return (
    <div>
      <h2>{username}'s Repositories</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>URL</th>
          </tr>
        </thead>
        <tbody>
          {repositories?.map(repo => (
            <tr key={repo.id}>
              <td>{repo.id}</td>
              <td>{repo.name}</td>
              <td><a href={repo.html_url} target="_blank" rel="noopener noreferrer">{repo.html_url}</a></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserRepositories;
